!****************************************************************
!   System:                     N2O
!   This potential is for 13 adiabatic states in the singlet A’ manifold.
!   The adiabatic states are obtained by diagonalization of a CPEM.
!   It was finalized on 06/06/2025
!   The ground-state diatomic potential for N2 contains damped dispersion.
!   In the coordinate array the first index is 1 for the first N, 2 for the second N, and 3 for O.
!
!   This subroutine is used for asymptotically extended dynamics!!
!
!   Functional form:            parametrically managed compatibilization by 
!                               deep neural network (PM-CDNN)
!   Common name:                N2O 13-states singlet A’ 2025
!   Number of derivatives:      first derivatives of adiabatic surfaces
!   Number of bodies:           3
!   Number of surfaces:         13
!   Notes:                      -Compile the subroutine requires LAPACK
!                                subroutine DSYEV
! 
!   Input:                      Cartesian coordinates in angstrom
!   Output:                     Adiabatic energies (e) in eV,
!                               derivatives of adiabataic energies (g) in
!                               eV/angstrom.
!   Reference:
!   Q. Meng, Y. Shu, Z. Varga, D. Zhang, and D. G. Truhlar, to be published.
!***********************************************************************

      subroutine pes(x,igrad,p,g,d)

      implicit none
      ! number of electronic state
      integer, parameter :: nstates=13
      integer, parameter :: natoms=3
      integer, intent(in) :: igrad
      double precision, intent(in) :: x(natoms,3)
      double precision, intent(out) :: p(nstates), g(nstates,natoms,3)
      double precision, intent(out) :: d(nstates,nstates,natoms,3)

      double precision :: t(nstates,nstates)

      integer :: iatom, idir, j, istate, jstate
      !initialize 
      p=0.d0
      g=0.d0
      d=0.d0

      ! no conversion needed, input is Angstrom, output is eV, eV/Angstrom, and 1/angstrom

      call energy_gradient(x,p,g,d,t,natoms,nstates)

      end

  subroutine energy_gradient(x,e,g,h,t,n,ns)
    ! n    - number of atoms: 3
    ! ns   - number of states: 13
    ! x    - Cartesian coordinates
    ! e    - adiabatic energies
    ! g    - derivatives of adiabatic energies w.r.t. Cartesians
    ! h    - nonadiabatic coupling vectors w.r.t. Cartesians
    ! t    - transformation matrix
    ! r    - internuclear distances
    ! gr   - derivatives of adiabatic energies w.r.t. internuclear
    ! distances
    ! v2b  - two-body energy contributions
    ! g2b  - derivatives of two-body energy contributions w.r.t.
    ! internuclear distances
    ! drdx - dr/dx matrix for converting derivatives

    implicit none
    integer, intent(in) :: n,ns
    real*8, intent(in) :: x(n,3)
    real*8, intent(inout) :: e(ns)
    real*8, intent(inout) :: g(ns,n,3)
    real*8, intent(inout) :: t(ns,ns)
    real*8, intent(inout) :: h(ns,ns,n,3)

    ! layers and their sizes
    real*8, save :: coeff_l0(3,30), coeff_l1(30,65), coeff_l2(65,95), coeff_l3(95,125), coeff_l4(125,91)
    real*8, save :: bias_l0(30), bias_l1(65), bias_l2(95), bias_l3(125), bias_l4(91)
    real*8 :: r(n*(n-1)/2)
    real*8 :: gr(ns,n*(n-1)/2)
    real*8 :: hr(ns,ns,n*(n-1)/2)
    real*8 :: v2b(ns),g2b(ns,n*(n-1)/2)  !!!!
    real*8 :: v2b_1(n*(n-1)/2,ns)
    real*8 :: drdx(n*(n-1)/2,3*n)
    integer :: i,j,k,l,m
    integer :: imollist(3)
    logical, save :: first_time_data=.true.

    ! In this version we used the new activation functional 
    ! So DPEM layer becomes:
    ! A(r)*B(r)*dpem_layer
    ! A(r)=0.5+0.5*tanh(2*(r+2)) !!
    ! B(r)=0.5+0.5*yanh(2*(-x+7.5))
    e=0.d0
    g=0.d0
    h=0.d0

    ! get ddnn coefficients and bias 
    if(first_time_data) then
      call assign_coeff_bias(coeff_l0,coeff_l1,coeff_l2,coeff_l3,coeff_l4,bias_l0,bias_l1,bias_l2,bias_l3,bias_l4)
      first_time_data=.false.
    endif
    call convert_xyz_to_r(x,r,n)
    ! calculate the two-body terms
    imollist(1)=2
    imollist(2)=3
    imollist(3)=3
    call ev2gm2m(r,v2b,v2b_1,g2b,imollist,1,n) !!!! 1 for gradient cal
    ! forward propagate sfp to energy 
    call backprop(r,n,ns,e,gr,hr,t,coeff_l0,coeff_l1,coeff_l2,coeff_l3,coeff_l4, &
      &bias_l0,bias_l1,bias_l2,bias_l3,bias_l4,v2b,v2b_1,g2b) !**********
    ! convert from gradient_r to gradient_xyz
    call grad_r_to_xyz(g,drdx,gr,r,x,n,ns)
    !call nac_r_to_xyz(h,drdx,hr,r,x,n,ns)

  endsubroutine energy_gradient

!===========================
! back propagation !!!!!!!!!!!!!!!!!!!!!!!!!!!*******************only change the number of dpem layer from 105 to 91 and coefficients
  subroutine backprop(r,n,ns,e,g,h,t,coeff_l0,coeff_l1,coeff_l2,coeff_l3,coeff_l4,&
    &bias_l0,bias_l1,bias_l2,bias_l3,bias_l4,v2b,v2b_1,g2b)
    implicit none
    integer, intent(in) :: n, ns
    real*8 :: r(n*(n-1)/2)
    real*8, intent(inout) :: e(ns), g(ns,n*(n-1)/2), h(ns,ns,n*(n-1)/2)
    real*8, intent(inout) :: t(ns,ns)
    real*8, intent(in) :: coeff_l0(3,30), coeff_l1(30,65), coeff_l2(65,95), coeff_l3(95,125), coeff_l4(125,91)
    real*8, intent(in) :: bias_l0(30), bias_l1(65), bias_l2(95), bias_l3(125), bias_l4(91)
    real*8, intent(in) :: v2b(ns), v2b_1(n*(n-1)/2,ns)
    real*8, intent(in) :: g2b(ns,n*(n-1)/2)
!    real*8, intent(inout) :: mb(ns,ns) !!!****************
    real*8 :: a0(30), a1(65), a2(95), a3(125), a4(91)
    real*8 :: z0(30), z1(65), z2(95), z3(125), z4(91)
    real*8 :: g0(3,30), g1(3,65), g2(3,95), g3(3,125), g4(3,91), g4p(91,3)
    real*8 :: dpem(ns,ns), dvdu(ns,91)
    real*8 :: dudr(ns,ns,3), tmpmat(ns,ns)
    integer :: map(3,13)
    real*8 :: e_0(13), sum_dis, s_j

    real*8 :: af_f=1.2, af_a=-2.0, af_b=4.0, order=4.0
    real*8 :: f, dfdr(n*(n-1)/2)
    real*8 :: dfdr_3b(ns,n*(n-1)/2), dfdr_2b(ns,n*(n-1)/2)

    real*8 :: ag_f=1.2, ag_a=-2.0, ag_b=6.0
    real*8 :: decay, ddecaydr(n*(n-1)/2)
    real*8 :: ddecaydr_3b(ns,n*(n-1)/2), ddecaydr_2b(ns,n*(n-1)/2)    

    integer :: sum1
    integer :: i,j,k,l
 
    !real*8 :: v2b(ns),g2b(ns,n*(n-1)/2)
    real*8 :: sum_v2b(ns), sum_g2b(ns,n*(n-1)/2)
    real*8 :: reordered_v2b(ns),reordered_g2b(ns,n*(n-1)/2)

    a0=0.0d0
    a1=0.0d0
    a2=0.0d0
    a3=0.0d0
    a4=0.0d0
    z0=0.0d0
    z1=0.0d0
    z2=0.0d0
    z3=0.0d0
    z4=0.0d0

    e=0.0d0
    g0=0.0d0
    g1=0.0d0
    g2=0.0d0
    g3=0.0d0
    g4=0.0d0

    call mproduct(r,coeff_l0,z0,1,3,30)
    z0=z0 +bias_l0
    call activation_gelu(z0,a0,30)

    call mproduct(a0,coeff_l1,z1,1,30,65)
    z1=z1 +bias_l1
    call activation_gelu(z1,a1,65)

    call mproduct(a1,coeff_l2,z2,1,65,95)
    z2=z2 +bias_l2
    call activation_gelu(z2,a2,95)
    
    call mproduct(a2,coeff_l3,z3,1,95,125)
    z3=z3 +bias_l3
    call activation_gelu(z3,a3,125)

    !diabatic layer, use activation functional 
    call mproduct(a3,coeff_l4,z4,1,125,91)
    z4=z4 +bias_l4
    call activation_functional_heviside(z4,a4,91,r,n*(n-1)/2,f)

    !construction many-body diabatic potential energy matrix (mb-dpem)
    do i=1,ns
      dpem(i,i)=a4(i)
    enddo
    do i=1,ns
      do j=i+1,ns
        call sumover(ns,i,sum1)
        k=ns-1+sum1+j-i
        dpem(i,j)=a4(k)
        dpem(j,i)=dpem(i,j)
      enddo
    enddo

!    mb=dpem !!!!*************

    !adding the two-body terms to mb-dpem
    do i=1,ns
      dpem(i,i)=dpem(i,i) + v2b(i)
    enddo

    ! diagonalize dpem
    call diagonalize(ns,dpem,e,t)

    ! cmpute dvdu 
    do i=1,ns
      do j=1,ns
        dvdu(i,j)=t(j,i)*t(j,i)
      enddo
    enddo 
    do i=1,ns
      do j=1,ns
        do k=j+1,ns
          call sumover(ns,j,sum1)
          l=ns-1+sum1+k-j
          dvdu(i,l)=2.0*t(j,i)*t(k,i)
        enddo
      enddo
    enddo 

   ! compute gradients 
   g0=coeff_l0   
   do i=1,3
     call activation_derivative_gelu(z0, a0, g0(i,:), 30)
   enddo 

   call mproduct(g0,coeff_l1,g1,3,30,65)

   do i=1,3
     call activation_derivative_gelu(z1, a1, g1(i,:), 65)
   enddo   

   call mproduct(g1,coeff_l2,g2,3,65,95)
   do i=1,3
     call activation_derivative_gelu(z2, a2, g2(i,:), 95)
   enddo

   call mproduct(g2,coeff_l3,g3,3,95,125)
   do i=1,3
     call activation_derivative_gelu(z3, a3, g3(i,:), 125)
   enddo 

   call mproduct(g3,coeff_l4,g4,3,125,91)
   ! here to add actional functional derivative
   call activation_functional_derivative_terms(g4,z4,91,r,n*(n-1)/2, dfdr)

   do i=1,3
     do j=1,91
       g4p(j,i)=g4(i,j)
     enddo
   enddo 
 
   do i=1,ns
     do j=1,3
     g4p(i,j) = g4p(i,j) + g2b(i,j)
     enddo
   enddo

   call mproduct(dvdu,g4p,g,ns,91,3)

   ! compute re-ordered v2b
   ! v2b_1(1,:) is NN diatomics, v2b_1(2/3,:) is NO diatomics
   ! this map can be found in Table 3 of the N2O 1A' paper

   map(1,1)=4
   map(1,2)=2
   map(1,3)=3
   map(1,4)=8
   map(1,5)=1
   map(1,6)=9
   map(1,7)=10
   map(1,8)=11
   map(1,9)=12
   map(1,10)=13
   map(1,11)=5
   map(1,12)=6
   map(1,13)=7

   map(2,1)=6
   map(2,2)=7
   map(2,3)=8
   map(2,4)=9
   map(2,5)=5
   map(2,6)=3
   map(2,7)=11
   map(2,8)=12
   map(2,9)=1
   map(2,10)=2
   map(2,11)=4
   map(2,12)=10
   map(2,13)=13

   map(3,:)=map(2,:) 

   e_0(1)=0.d0
   e_0(2)=1.97
   e_0(3)=1.97
   e_0(4)=1.97
   do i=5,13
     e_0(i)=2.38
   enddo

   sum_v2b=0.d0
   sum_g2b=0.d0
   reordered_v2b=0.d0
   reordered_g2b=0.d0

   do i=1,13
     sum_v2b(i)=0.d0
     do j=1,3
       sum_v2b(i)=sum_v2b(i)+v2b_1(j,map(j,i))
       sum_g2b(i,j)=g2b(map(j,i),j)
     enddo
   enddo

   sum_dis=exp(-r(1))+exp(-r(2))+exp(-r(3))

   do i=1,13
     if (sum_dis>1.d-10) then
       reordered_v2b(i)=sum_v2b(i)
       do j=1,3
         reordered_v2b(i)=reordered_v2b(i)+exp(-r(j))/sum_dis*e_0(map(j,i))
       enddo
     else
       reordered_v2b(i)=e_0(i)
     endif
   enddo

   do i=1,13
     if (sum_dis>1.d-10) then
       do j=1,3
         s_j = exp(-r(j))/sum_dis
         reordered_g2b(i,j)=sum_g2b(i,j) - s_j*(s_j-1.0)
       enddo
     else
       reordered_g2b(i,:)=0.d0
     endif
   enddo

   call decay_function_heviside(r, n*(n-1)/2, ag_f, ag_a, ag_b, order, decay)
   call decay_function_heviside_derivative(r, n*(n-1)/2, ag_f, ag_a, ag_b, order, ddecaydr)   

   ! asymptotic dynamics
   do i=1,ns
     do j=1,n*(n-1)/2
       ddecaydr_3b(i,j)=e(i)*ddecaydr(j)
       ddecaydr_2b(i,j)=reordered_v2b(i)*ddecaydr(j)     
     enddo
   enddo

   e=decay*e+(1.0-decay)*reordered_v2b
   g=decay*g+(1.0-decay)*reordered_g2b+ddecaydr_3b-ddecaydr_2b

   h=0.d0

  endsubroutine backprop

!=========================
!activation function, geluG
  subroutine activation_gelu(z, a, n)
    integer i,n
    real*8, intent(in) :: z(n)
    real*8, intent(inout) :: a(n)

    do i=1,n
      a(i)=0.5*z(i)*(1+erf(z(i)/sqrt(2.d0)))
    enddo

  end subroutine activation_gelu

  subroutine activation_derivative_gelu(z, a, b, n)
    integer i,n
    real*8, intent(in) :: z(n), a(n)
    real*8, intent(inout) :: b(n)

    do i=1,n
!     b(i)=b(i)*(0.5*erf(z(i)/sqrt(2.d0))+0.398942*exp(-z(i)**2/2)*z(i)+0.5)
      b(i)=b(i)*(a(i)/z(i) + 0.398942*z(i)*exp(-z(i)**2/2) )
    enddo

  end subroutine activation_derivative_gelu
!=============================
!activation functional heviside
! A(r)*B(r)*dpem_layer
! the f,a,b parameters are 2, -1, and 4.0
! A(r)=0.5+0.5*tanh(2*(r+1))
! B(r)=0.5+0.5*tanh(2*(-x+4.0))
  subroutine activation_functional_heviside(z, a, n, r, nbonds, f)
    integer, intent(in) :: n, nbonds
    real*8, intent(in) :: z(n)
    real*8, intent(in) :: r(nbonds)
    real*8, intent(inout) :: a(n)
    real*8, intent(out) :: f
    real*8 :: r_in, Ar, Br
    integer :: max_index
    real*8, parameter :: af_f=1.2, af_a=-2.0, af_b=4.0, order=4.0


    integer :: npairs, ibond, jbond, ipair
    real*8 :: pair_sum, bond_sum

    pair_sum=0.d0
    do ibond=1,nbonds
    do jbond=ibond+1, nbonds
      pair_sum=pair_sum+(r(ibond)+r(jbond))**order
    enddo
    enddo
    pair_sum=pair_sum**(1/order)

    bond_sum=0.d0
    do ibond=1,nbonds
      bond_sum=bond_sum+r(ibond)**order
    enddo
    bond_sum=bond_sum**(1/order)

    r_in=pair_sum-bond_sum

    Ar=0.5+0.5*tanh(af_f*(r_in-af_a))
    Br=0.5+0.5*tanh(af_f*(-r_in+af_b))

    f=Ar*Br

    a=f*z

  end subroutine activation_functional_heviside

!=============================
!add activation functional derivative terms
!call activation_functional_derivative_terms(g4,21,n*(n-1)/2,z4)
  subroutine activation_functional_derivative_terms(g, z, n, r, nbonds, dfdr)
    integer, intent(in) :: n, nbonds
    real*8, intent(in) :: z(n)
    real*8, intent(in) :: r(nbonds)
    real*8, intent(inout) :: g(nbonds,n)
    real*8, intent(out) :: dfdr(nbonds)

    real*8 :: r_in, Ar, Br
    real*8, parameter :: af_f=1.2, af_a=-2.0, af_b=4.0, order=4.0
    real*8 :: dfdr_in, dr_indr(nbonds)

    integer :: npairs, ibond, jbond, ipair
    real*8 :: r_in_num
    real*8 :: pair_sum, bond_sum, pair_sum_num, bond_sum_num

    real*8 :: gr_num(nbonds), r_num(nbonds), Ar1, Br1, Ar2, Br2
    real*8 :: diff

    pair_sum=0.d0
    do ibond=1,nbonds
    do jbond=ibond+1, nbonds
      pair_sum=pair_sum+(r(ibond)+r(jbond))**order
    enddo
    enddo

    bond_sum=0.d0
    do ibond=1,nbonds
      bond_sum=bond_sum+r(ibond)**order
    enddo

    r_in=pair_sum**(1/order)-bond_sum**(1/order)

    Ar=0.5+0.5*tanh(af_f*(r_in-af_a))
    Br=0.5+0.5*tanh(af_f*(-r_in+af_b))

    dfdr_in=af_f*(-0.25*tanh(af_f*(r_in-af_a))-0.25)/((cosh(af_f*(-r_in+af_b)))**2) + af_f*(0.25+0.25*tanh(af_f*(-r_in+af_b)))/((cosh(af_f*(r_in-af_a)))**2)

    dr_indr=0.d0
    do ibond=1,nbonds
      do jbond=1,nbonds
      if (ibond.ne.jbond) then
        dr_indr(ibond)=dr_indr(ibond)+1/order*((pair_sum)**(-(order-1.0)/order))*order*((r(ibond)+r(jbond))**(order-1.0))
      endif
      enddo
    enddo

    do ibond=1,nbonds
      dr_indr(ibond)=dr_indr(ibond)-1/order*((bond_sum)**(-(order-1.0)/order))*order*(r(ibond)**(order-1.0))
    enddo

    do ibond=1,nbonds
      dfdr(ibond)=dfdr_in*dr_indr(ibond)
    enddo

    do i=1,nbonds
      g(i,:)=dfdr(i)*z(:)+Ar*Br*g(i,:)
    enddo



  end subroutine activation_functional_derivative_terms

!=============================
!decay function
! A(r)*B(r)*dpem_layer
! the f,a,b parameters are 2, -1, and 4.0
! A(r)=0.5+0.5*tanh(2*(r+1))
! B(r)=0.5+0.5*tanh(2*(-x+4.0))
  subroutine decay_function_heviside(r, nbonds, af_f, af_a, af_b, order, f)
    integer, intent(in) :: nbonds
    real*8, intent(in) :: af_f, af_a, af_b, order
    real*8, intent(in) :: r(nbonds)
    real*8, intent(out) :: f

    real*8 :: r_in, Ar, Br
    integer :: max_index

    integer :: npairs, ibond, jbond, ipair
    real*8 :: pair_sum, bond_sum

    pair_sum=0.d0
    do ibond=1,nbonds
    do jbond=ibond+1, nbonds
      pair_sum=pair_sum+(r(ibond)+r(jbond))**order
    enddo
    enddo
    pair_sum=pair_sum**(1/order)

    bond_sum=0.d0
    do ibond=1,nbonds
      bond_sum=bond_sum+r(ibond)**order
    enddo
    bond_sum=bond_sum**(1/order)

    r_in=pair_sum-bond_sum

    Ar=0.5+0.5*tanh(af_f*(r_in-af_a))
    Br=0.5+0.5*tanh(af_f*(-r_in+af_b))

    f=Ar*Br
  end subroutine decay_function_heviside


!=============================
!add activation functional derivative terms
!call activation_functional_derivative_terms(g4,21,n*(n-1)/2,z4)
  subroutine decay_function_heviside_derivative(r, nbonds, af_f, af_a, af_b, order, dfdr)
    integer, intent(in) :: nbonds
    real*8, intent(in) :: r(nbonds)
    real*8, intent(in) :: af_f, af_a, af_b, order
    real*8, intent(out) :: dfdr(nbonds)

    real*8 :: r_in, Ar, Br
    real*8 :: dfdr_in, dr_indr(nbonds)

    integer :: npairs, ibond, jbond, ipair
    real*8 :: r_in_num
    real*8 :: pair_sum, bond_sum, pair_sum_num, bond_sum_num

    real*8 :: gr_num(nbonds), r_num(nbonds), Ar1, Br1, Ar2, Br2
    real*8 :: diff

    pair_sum=0.d0
    do ibond=1,nbonds
    do jbond=ibond+1, nbonds
      pair_sum=pair_sum+(r(ibond)+r(jbond))**order
    enddo
    enddo

    bond_sum=0.d0
    do ibond=1,nbonds
      bond_sum=bond_sum+r(ibond)**order
    enddo

    r_in=pair_sum**(1/order)-bond_sum**(1/order)

    Ar=0.5+0.5*tanh(af_f*(r_in-af_a))
    Br=0.5+0.5*tanh(af_f*(-r_in+af_b))

    dfdr_in=af_f*(-0.25*tanh(af_f*(r_in-af_a))-0.25)/((cosh(af_f*(-r_in+af_b)))**2) + af_f*(0.25+0.25*tanh(af_f*(-r_in+af_b)))/((cosh(af_f*(r_in-af_a)))**2)

    dr_indr=0.d0
    do ibond=1,nbonds
      do jbond=1,nbonds
      if (ibond.ne.jbond) then
        dr_indr(ibond)=dr_indr(ibond)+1/order*((pair_sum)**(-(order-1.0)/order))*order*((r(ibond)+r(jbond))**(order-1.0))
      endif
      enddo
    enddo

    do ibond=1,nbonds
      dr_indr(ibond)=dr_indr(ibond)-1/order*((bond_sum)**(-(order-1.0)/order))*order*(r(ibond)**(order-1.0))
    enddo

    do ibond=1,nbonds
      dfdr(ibond)=dfdr_in*dr_indr(ibond)
    enddo

  end subroutine decay_function_heviside_derivative  

!==============================
! used to compute index in DPEM
  subroutine sumover(a,b,sum1)
    integer, intent(in) :: a, b
    integer, intent(out) :: sum1
    integer :: num

    sum1=1-a
    do num=a, a-b+1, -1
      sum1=sum1+num
    enddo
  end subroutine sumover

!==============================
! matrix diagonalization
! subroutine diagonalize(n,A_ss,B_ss,U_ss)
  subroutine diagonalize(n,A_ss,EV_s,U_ss)
    implicit none
    ! parameters
    integer, intent(in) :: n
    real*8, intent(in) :: A_ss(n,n)
!   real*8, intent(out) :: B_ss(n,n)
    real*8, intent(out) :: U_ss(n,n)
    ! internal variables
!   real*8 :: EV_s(n)
    real*8, intent(out) :: EV_s(n)
    integer :: io,i
    real*8,allocatable :: lapack_work_d(:)
    integer, save :: lapack_lwork_d 
    logical, save :: first_time_diag=.true.

    U_ss=A_ss
    if (first_time_diag) then
      lapack_lwork_d= -1
      allocate( lapack_work_d(2) )
      call dsyev('V','L',n,U_ss,n,EV_s,lapack_work_d,lapack_lwork_d,io)
      lapack_lwork_d=int(lapack_work_d(1))
      deallocate ( lapack_work_d )
      first_time_diag=.false.
    endif
    allocate( lapack_work_d(lapack_lwork_d) )
    call dsyev('V','L',n,U_ss,n,EV_s,lapack_work_d,lapack_lwork_d,io)
    ! U_ss already holds the transformation matrix
    ! now  building the diagonal matrix A_ss
!   B_ss=0.d0
!   do i=1,n
!     B_ss(i,i)=EV_s(i)
!   enddo

    return

  end subroutine diagonalize

!==========================
! convert de/dr to de/dxyz
  subroutine grad_r_to_xyz(g,drdx,gr,r,x,n,ns)
    implicit none
    integer, intent(in) :: n, ns
    real*8, intent(in) :: x(n,3)
    real*8, intent(in) :: r(n*(n-1)/2)
    real*8, intent(in) :: gr(ns,n*(n-1)/2)
    real*8, intent(inout) :: g(ns,n,3)
    real*8, intent(inout) :: drdx(n*(n-1)/2,3*n)

    real*8 ::  gx(ns,3*n)
    integer :: i,j

    drdx=0.0d0

    ! compute drdx
    drdx(1,1)=(x(1,1)-x(2,1))/r(1)
    drdx(1,2)=(x(1,2)-x(2,2))/r(1)
    drdx(1,3)=(x(1,3)-x(2,3))/r(1)
    drdx(1,4)=-drdx(1,1)
    drdx(1,5)=-drdx(1,2)
    drdx(1,6)=-drdx(1,3)
    drdx(2,1)=(x(1,1)-x(3,1))/r(2)
    drdx(2,2)=(x(1,2)-x(3,2))/r(2)
    drdx(2,3)=(x(1,3)-x(3,3))/r(2)
    drdx(2,7)=-drdx(2,1)
    drdx(2,8)=-drdx(2,2)
    drdx(2,9)=-drdx(2,3)
    drdx(3,4)=(x(2,1)-x(3,1))/r(3)
    drdx(3,5)=(x(2,2)-x(3,2))/r(3)
    drdx(3,6)=(x(2,3)-x(3,3))/r(3)
    drdx(3,7)=-drdx(3,4)
    drdx(3,8)=-drdx(3,5)
    drdx(3,9)=-drdx(3,6)

    call mproduct(gr,drdx,gx,ns,n*(n-1)/2,3*n)

    do i=1,n
      g(:,i,1)=gx(:,3*(i-1)+1)
      g(:,i,2)=gx(:,3*(i-1)+2)
      g(:,i,3)=gx(:,3*(i-1)+3)
    enddo 

  end subroutine grad_r_to_xyz

!==========================
! convert d/dr to d/dxyz for NAC
  subroutine nac_r_to_xyz(h,drdx,hr,r,x,n,ns)
    implicit none
    integer, intent(in) :: n, ns
    real*8, intent(in) :: x(n,3)
    real*8, intent(in) :: r(n*(n-1)/2)
    real*8, intent(in) :: hr(ns,ns,n*(n-1)/2)
    real*8, intent(inout) :: h(ns,ns,n,3)
    real*8, intent(inout) :: drdx(n*(n-1)/2,3*n)

    real*8 ::  hr_vec(ns*ns,n*(n-1)/2)
    real*8 ::  hx(ns*ns,3*n)

    integer :: i,j,k,l

    drdx=0.0d0

    ! compute drdx
    drdx(1,1)=(x(1,1)-x(2,1))/r(1)
    drdx(1,2)=(x(1,2)-x(2,2))/r(1)
    drdx(1,3)=(x(1,3)-x(2,3))/r(1)
    drdx(1,4)=-drdx(1,1)
    drdx(1,5)=-drdx(1,2)
    drdx(1,6)=-drdx(1,3)
    drdx(2,1)=(x(1,1)-x(3,1))/r(2)
    drdx(2,2)=(x(1,2)-x(3,2))/r(2)
    drdx(2,3)=(x(1,3)-x(3,3))/r(2)
    drdx(2,7)=-drdx(2,1)
    drdx(2,8)=-drdx(2,2)
    drdx(2,9)=-drdx(2,3)
    drdx(3,4)=(x(2,1)-x(3,1))/r(3)
    drdx(3,5)=(x(2,2)-x(3,2))/r(3)
    drdx(3,6)=(x(2,3)-x(3,3))/r(3)
    drdx(3,7)=-drdx(3,4)
    drdx(3,8)=-drdx(3,5)
    drdx(3,9)=-drdx(3,6)

    do i=1,ns
      do j=1,ns
        k=(i-1)*ns+j
        hr_vec(k,:)=hr(i,j,:)
      enddo
    enddo
    call mproduct(hr_vec,drdx,hx,ns*ns,n*(n-1)/2,3*n)

    do i=1,n
      do j=1,ns
        do k=1,ns
          l=(j-1)*ns+k
          h(j,k,i,1)=hx(l,3*(i-1)+1)
          h(j,k,i,2)=hx(l,3*(i-1)+2)
          h(j,k,i,3)=hx(l,3*(i-1)+3)
        enddo
      enddo
    enddo

  end subroutine nac_r_to_xyz

!==========================
! convert xyz to r
  subroutine convert_xyz_to_r(x,r,n)
    implicit none
    integer, intent(in) :: n
    real*8, intent(in) :: x(n,3)
    real*8, intent(out) :: r(n*(n-1)/2)
    integer :: i, j, l

    l=1
    !pairs of distances
    do i=1,n
      do j=i+1,n
        r(l)=sqrt((x(i,1)-x(j,1))**2+(x(i,2)-x(j,2))**2+(x(i,3)-x(j,3))**2)
        l=l+1
      enddo
    enddo

  endsubroutine convert_xyz_to_r

!=========================
! matrix vector product 
  subroutine mproduct(a,b,c,l,m,n)
    implicit none
    integer, intent(in) :: l, m, n
    real*8, intent(in) :: a(l,m), b(m,n)
    real*8, intent(inout) :: c(l,n)

    integer :: i, j, k
  
    do i=1,l
      do j=1,n
        c(i,j)=0.d0
        do k=1,m
          c(i,j)=c(i,j)+a(i,k)*b(k,j)
        enddo
      enddo
    enddo
    
    return
  endsubroutine mproduct

