      subroutine ev2gm2m(dist,v2b,v2b_1,g2b,imollist,igrad,n)
!Bohr

      implicit none

      integer,intent(in) :: imollist(3), igrad !igrad=0 /1
      integer,intent(in) :: n
      double precision,intent(in)  :: dist(n*(n-1)/2)
      double precision,intent(out) :: v2b(13), v2b_1(3,13), g2b(13,3)
      double precision :: v(13), grad(13), disp
      double precision :: r
      integer :: i,j,imol

      ! dist should be in Ang
      ! v2b is in kcal/mol
      ! grad2b is in kcal/molAng
	  ! 1:    N(4S) + N(4S) + O(3P)
	  ! 2-4:  N(4S) + N(4S) + O(1D)
	  ! 5-13: N(4S) + N(2D) + O(3P)
      v2b(1)   =  0.0d0
      v2b(2)   =  1.97
      v2b(3)   =  1.97
      v2b(4)   =  1.97
      v2b(5)   =  2.38
      v2b(6)   =  2.38
      v2b(7)   =  2.38
      v2b(8)   =  2.38
      v2b(9)   =  2.38
      v2b(10)   = 2.38
      v2b(11)   = 2.38
      v2b(12)   = 2.38
      v2b(13)   = 2.38

      g2b = 0.0d0
      v2b_1 = 0.d0 
      do i=1,n*(n-1)/2
        r=dist(i) !!!*0.529177d0    for Bohr
        imol=imollist(i)

        call ev2gm2(r,v,grad,imol,igrad,disp)
        v2b_1(i,:)=v/23.061d0
        v2b = v2b + v/23.061d0
        if (igrad.eq.1) then
          do j=1,13
            g2b(j,i) = grad(j)/23.061d0 !! (23.061d0/0.529177d0) for Bohr
          enddo
        endif
      enddo

      end subroutine ev2gm2m

      subroutine ev2gm2(r,v,grad,imol,igrad,disp) 
!**********************************************************************
!
! Compute the diatomic potential of groupd-state triplet O2
!
! References: J. Chem. Phys. 132, 074307 (2010)
!
! Input:  r      interatomic distance in Angstrom
! Output: V      potential in kcal/mol
!         grad   gradient (kcal/mol)/Angstrom
!
!**********************************************************************
      implicit none

      integer,intent(in) :: imol, igrad
      double precision,intent(in)  :: r
      double precision,intent(out) :: v(13), grad(13)
      double precision :: alpha,beta,as(0:7)
      double precision :: gam, del    
      integer :: i,j,k 
! Dispersion variables
      double precision :: dist(1),disp,dispdr(1)

       v=0.0d0
       grad=0.0d0

! Calculate dispersion correction for all states
        dist(1)=r
        call d3disp(dist,disp,dispdr,1,imol)
      do i=1,13
        if (imol.eq.2) then  !!! N2 data imol=2

        ! U11 N2(A 3Sig_u+)+O(3P)
         if (i.eq.1) then
alpha =         9.8488
beta =  0.7809
as(0) =         359353.5927
as(1) =         -930233.5089
as(2) =         1328720.361
as(3) =         -1274436.274
as(4) =         902480.1877
as(5) =         -469392.28
as(6) =         170567.2991
as(7) =         -32565.637

! U22 was V2 N2(X 1Sig_g+)+O(1D_1.96)
         else if ((i.eq.2).or.(i.eq.3).or.(i.eq.4)) then
alpha =     10.3939
beta =  0.4615
as(0) =     17245.9669
as(1) =     6957.6211
as(2) =     1869.6047
as(3) =     -1293.9496
as(4) =     -18.2465
as(5) =     13.3293
as(6) =     -3.9914
as(7) =     0.7002

! N2(w 3Del_u)+O(3P)
          else if ((i.eq.5).or.(i.eq.6).or.(i.eq.7)) then
alpha = 	3.9117
beta = 	0.8532
as(0) = 	975086.6175
as(1) = 	-4009384.418
as(2) = 	7818516.455
as(3) = 	-9272102.251
as(4) = 	7184822.208
as(5) = 	-3625761.788
as(6) = 	1107721.913
as(7) = 	-160431.5751

!!0ld U5 in 0210  N2(X 1Sig_g+)+O(1S)+>1.53_V11>_1.82_V10
!!0ld U5 in 0210  N2(X 1Sig_g+)+O(1S)+>1.53_V11>_1.82_V10 0922 
         else if (i.eq.8) then
alpha =         4.6846
beta =  0.9005
as(0) =         15208082.1866
as(1) =         -83289339.3571
as(2) =         202423061.4163
as(3) =         -281846855.1257
as(4) =         242231082.7584
as(5) =         -128367791.2394
as(6) =         38869580.3125
as(7) =         -5204701.5137
!N2(B' 3Sig_u-)+O(3P)>1.7_V11>1.82_V10 
          else if ((i.eq.9).or.(i.eq.10)) then
alpha = 	1.6333
beta = 	1.2116
as(0) = 	-1341082.372
as(1) = 	7665711.817
as(2) = 	-20029982.13
as(3) = 	31570662.56
as(4) = 	-32989826.96
as(5) = 	23231374.91
as(6) = 	-10343157.04
as(7) = 	2279016.835
gam = 	396.501
del =	4.5568
! N2(B 3Pi_g)+O(3P)
          else if ((i.eq.11).or.(i.eq.12).or.(i.eq.13)) then
alpha =     10.342
beta =  0.7045
as(0) =     20065.4904
as(1) =     1140.4593
as(2) =     -9781.3064
as(3) =     26621.9383
as(4) =     -25103.6272
as(5) =     20141.5967
as(6) =     -9606.4985
as(7) =     1542.6002
endif
        else if (imol.eq.3) then   ! NO data imol=3
            
! U11 NO(a 4Π_i) + N(4S）
          if (i.eq.1) then
alpha =     3.5124
beta =  0.9476
as(0) =     17862980.6515
as(1) =     -53774481.5152
as(2) =     40173905.4211
as(3) =     24722189.3018
as(4) =     -35421450.1351
as(5) =     -9580810.3340
as(6) =     23584658.8525
as(7) =     -7549918.6887

! U22 NO(b 4Σ_-) + N(4S)
        else if (i.eq.2) then
alpha =     3.4397
beta =  0.9197
as(0) =     10120680.3619
as(1) =     -40294100.0092
as(2) =     59510743.7425
as(3) =     -29292507.9761
as(4) =     -19401365.8983
as(5) =     32353447.7571
as(6) =     -15727759.4932
as(7) =     2747022.6440

! U33 NO(B)V8_1.24>V9_1.28-1.36>v10_1.79>V8_2.1>v3_4
         else if (i.eq.3) then
alpha = 	4.6983
beta = 	0.8748
as(0) = 	5957352.9891
as(1) = 	-29979806.3402
as(2) = 	67986112.1294
as(3) = 	-89274390.0940
as(4) = 	72803880.7392
as(5) = 	-36626995.5272
as(6) = 	10461847.5660
as(7) = 	-1302962.9786
! U44 NO(B)_V11_1.83>v9_2.2>v4
          else if (i.eq.4) then
alpha = 	9.2040
beta = 	0.7494
as(0) = 	210952.0357
as(1) = 	-478529.2287
as(2) = 	598049.1525
as(3) = 	-449645.2352
as(4) = 	208034.2800
as(5) = 	-43542.8243
as(6) = 	-4880.5077
as(7) = 	3384.9619
! U55-99 NO(X 2Π_r) +N(2D_2.365)
          else if ((i.eq.5).or.(i.eq.6).or.(i.eq.7) &
.or.(i.eq.8).or.(i.eq.9))  then
alpha =     6.9634
beta =  0.7557
as(0) =     55496.4320
as(1) =     -101113.9076
as(2) =     133668.3275
as(3) =     -120762.1170
as(4) =     83209.2468
as(5) =     -38238.3803
as(6) =     10620.8346
as(7) =     -2058.6642

!U1010 NO(B)_V12_1.85>V10
          else if (i.eq.10) then
alpha = 	2.3796
beta = 	1.3717
as(0) = 	-15872.0826
as(1) = 	103238.8032
as(2) = 	-314076.1610
as(3) = 	638773.1501
as(4) = 	-905387.3781
as(5) = 	1009442.5608
as(6) = 	-859462.8754
as(7) = 	553194.6866
gam = 	13.9616
del = 	6.5204
                  
! U1111-1212 v7_1.27>v8_1.29-1.78>v12_1.89
          else if ((i.eq.11).or.(i.eq.12)) then
alpha = 	0.6451
beta = 	2.9274
as(0) = 	-499.4014
as(1) = 	880.5500
as(2) = 	11297.9171
as(3) = 	31596.0913
as(4) = 	61453279.0827
as(5) = 	25171.0712
as(6) = 	-14565.1480
as(7) = 	18409.0358
gam = 	63.4187
del = 	2.7803
! U1313 NO(B)_V13
          else if (i.eq.13) then
alpha = 	1.9283
beta = 	1.1731
as(0) = 	-3647991.0178
as(1) = 	22555622.5160
as(2) = 	-62773283.9261
as(3) = 	102966446.3089
as(4) = 	-108478512.7947
as(5) = 	73944633.2290
as(6) = 	-30367176.0640
as(7) = 	5837257.9125
gam = 	305.2223
del = 	5.5142          
          
 endif
        endif      
      
        do k=0,7
          v(i)= v(i) + as(k)*dexp(-alpha*beta**k*r**2)
        enddo

        if (imol.eq.2) then
          if ((i.eq.9).or.(i.eq.10)) then
           v(i)= v(i) + gam*dexp(-del*(r-1.7d0)**2)
          else if ((i.eq.2).or.(i.eq.3).or.(i.eq.4)) then
           call n2ground(r,v(i),grad(i),imol,igrad)
          endif
        else if (imol.eq.3) then
          if ((i.eq.10).or.(i.eq.11).or.(i.eq.12).or.(i.eq.13)) then
             v(i)= v(i) + gam*dexp(-del*(r-1.7d0)**2)
          else if ((i.eq.5).or.(i.eq.6).or.(i.eq.7).or.(i.eq.8).or.(i.eq.9)) then
           call noground(r,v(i),grad(i),imol,igrad)
          endif
        endif

 !       ! Add D3 dispersion correction
 !       v(i)=v(i)+disp  !!!

        ! Compute the gradient if needed
        if (igrad.eq.1 .and. .not.((imol.eq.2 .and. i.eq.2) .or. (imol.eq.2 .and. i.eq.3) .or. (imol.eq.2 .and. i.eq.4) .or. &
                (imol.eq.3 .and. i.eq.5) .or. (imol.eq.3 .and. i.eq.6) .or. &
                (imol.eq.3 .and. i.eq.7) .or. (imol.eq.3 .and. i.eq.8) .or. &
                (imol.eq.3 .and. i.eq.9))) then


          do k=0,7
            grad(i)=grad(i)-2.d0*as(k)*alpha*beta**k*r*dexp(-alpha*beta**k*r**2)
          enddo
        !gam del were not used, add this part if necessary
          if (imol.eq.2) then
            if ((i.eq.9).or.(i.eq.10)) then
              grad(i)=grad(i)-2.0d0*del*gam*(r-1.7d0)*dexp(-del*(r-1.7d0)**2)
            endif
          else if (imol.eq.3) then
          if ((i.eq.10).or.(i.eq.11).or.(i.eq.12).or.(i.eq.13)) then
              grad(i)=grad(i)-2.0d0*del*gam*(r-1.7d0)*dexp(-del*(r-1.7d0)**2)
            endif
          endif
!          grad(i)= grad(i) + dispdr(1)
        endif

      enddo
      return
      end subroutine ev2gm2

      subroutine d3disp(dist,disp,dispdr,igrad,imol)     
!**********************************************************************
! Dispersion correction based on Grimme's D3(BJ) calculation for
! diatomic pairs
!
! Several subroutines of DFTD3 V3.1 Rev 1 by Grimme were merged into 
! subroutine edisp and they have been heavily modified to calculate only
! that dispersion energy correction that is needed.
!
! S. Grimme, J. Antony, S. Ehrlich and H. Krieg
! J. Chem. Phys, 132 (2010), 154104
! and 
! S. Grimme, S. Ehrlich and L. Goerigk, J. Comput. Chem, 32 (2011),
! 1456-1465
!
! The C6 values are fixed.
!
!**********************************************************************

      double precision cn(2),s6,s8,rs6,rs8
      double precision dist(1), e6(1), e8(1), disp, dispdr(1), c6(2)
      double precision e6dr(1),e8dr(1)
      integer iz(2), mxc(94), i, j, igrad
      double precision c6ab(94,94,5,5,3)
      double precision r2r4(94)
      double precision autoang,autokcal
      integer imol

      autoang =0.52917726d0
      autokcal=627.509541d0

! Generalized parameters for BJ damping from P. Verma, B. Wang, 
! L. E. Fernandez, and D. G. Truhlar, J. Phys. Chem. A 121, 2855 (2017)
      s6= 1.0d0
      s8= 2.0d0
      rs6= 0.5299d0 !!it's not unit conversion
      rs8= 2.20d0

      do i=1,1
      dist(i)=dist(i)/autoang

     enddo

      if (imol.eq.2) then !!N2
! iz for N2 system
      iz(1)=7
      iz(2)=7

! C6 for N2 system
      c6(1)=19.7d0 
      c6(2)=19.7d0 
      else if (imol.eq.3) then ! NO
! iz for NO system
      iz(1)=7
      iz(2)=8

! C6 for NO system
      c6(1)=16.7d0 
      c6(2)=16.7d0     
      else
! currently imol = 2 & 3 are used
      stop
      endif

! Calculate dispersion correction
      call edisp(94,5,2,dist,iz,mxc, &
           rs6,rs8,e6,e8,e6dr,e8dr,c6,0)

      disp = 0.0d0

      do i=1,1
      disp =disp + (-s6*e6(i)-s8*e8(i))*autokcal
      enddo

      if (igrad .eq. 1) then
      call edisp(94,5,2,dist,iz,mxc, &
           rs6,rs8,e6,e8,e6dr,e8dr,c6,1)

      dispdr(:) = 0.0d0

      do i=1,1
      dispdr(i) =dispdr(i) + (-s6*e6dr(i)-s8*e8dr(i))*autokcal/autoang
      enddo
      endif
      do i=1,1
      dist(i)=dist(i)*autoang
      enddo

      end subroutine d3disp

!**********************************************************************
! compute energy
!**********************************************************************
      subroutine edisp(max_elem,maxc,n,dist,iz,mxc, &
                 rs6,rs8,e6,e8,e6dr,e8dr,c6a,igrad)

      integer n,iz(2),max_elem,maxc,mxc(max_elem) 
      double precision dist(1),r2r4(max_elem),r0ab(max_elem,max_elem)
      double precision rs6,rs8,rcov(max_elem)
      double precision c6ab(max_elem,max_elem,maxc,maxc,3)
      double precision e6(1), e8(1), c6a(2), e6dr(1), e8dr(1)
       
      integer iat,jat,igrad
      double precision r,tmp,c6,c8,a1,a2
      double precision damp6,damp8
      double precision cn(n)
      double precision r2ab(n*n),cc6ab(n*n),dmp(n*n)
      integer step

      e6(:) =0.0d0
      e8(:) =0.0d0

      e6dr(:) =0.0d0
      e8dr(:) =0.0d0

      a1=rs6
      a2=rs8 

!  r2r4 =sqrt(0.5*r2r4(i)*dfloat(i)**0.5 ) with i=elementnumber
!  the large number of digits is just to keep the results consistent
!  with older versions. They should not imply any higher accuracy than
!  the old values
      r2r4(1:94)=(/ &
      2.00734898d0,  1.56637132d0,  5.01986934d0,  3.85379032d0, &
      3.64446594d0,  3.10492822d0,  2.71175247d0,  2.59361680d0, &
      2.38825250d0,  2.21522516d0,  6.58585536d0,  5.46295967d0, &
      5.65216669d0,  4.88284902d0,  4.29727576d0,  4.04108902d0, &
      3.72932356d0,  3.44677275d0,  7.97762753d0,  7.07623947d0, &
      6.60844053d0,  6.28791364d0,  6.07728703d0,  5.54643096d0, &
      5.80491167d0,  5.58415602d0,  5.41374528d0,  5.28497229d0, &
      5.22592821d0,  5.09817141d0,  6.12149689d0,  5.54083734d0, &
      5.06696878d0,  4.87005108d0,  4.59089647d0,  4.31176304d0, &
      9.55461698d0,  8.67396077d0,  7.97210197d0,  7.43439917d0, &
      6.58711862d0,  6.19536215d0,  6.01517290d0,  5.81623410d0, &
      5.65710424d0,  5.52640661d0,  5.44263305d0,  5.58285373d0, &
      7.02081898d0,  6.46815523d0,  5.98089120d0,  5.81686657d0, &
      5.53321815d0,  5.25477007d0, 11.02204549d0,  0.15679528d0, &
      9.35167836d0,  9.06926079d0,  8.97241155d0,  8.90092807d0, &
      8.85984840d0,  8.81736827d0,  8.79317710d0,  7.89969626d0, &
      8.80588454d0,  8.42439218d0,  8.54289262d0,  8.47583370d0, &
      8.45090888d0,  8.47339339d0,  7.83525634d0,  8.20702843d0, &
      7.70559063d0,  7.32755997d0,  7.03887381d0,  6.68978720d0, &
      6.05450052d0,  5.88752022d0,  5.70661499d0,  5.78450695d0, &
      7.79780729d0,  7.26443867d0,  6.78151984d0,  6.67883169d0, &
      6.39024318d0,  6.09527958d0, 11.79156076d0, 11.10997644d0, &
      9.51377795d0,  8.67197068d0,  8.77140725d0,  8.65402716d0, &
      8.53923501d0,  8.85024712d0 /)

! these new data are scaled with k2=4./3.  and converted a_0 via
! autoang=0.52917726d0
      rcov(1:94)=(/ &
       0.80628308d0, 1.15903197d0, 3.02356173d0, 2.36845659d0, &
       1.94011865d0, 1.88972601d0, 1.78894056d0, 1.58736983d0, &
       1.61256616d0, 1.68815527d0, 3.52748848d0, 3.14954334d0, &
       2.84718717d0, 2.62041997d0, 2.77159820d0, 2.57002732d0, &
       2.49443835d0, 2.41884923d0, 4.43455700d0, 3.88023730d0, &
       3.35111422d0, 3.07395437d0, 3.04875805d0, 2.77159820d0, &
       2.69600923d0, 2.62041997d0, 2.51963467d0, 2.49443835d0, &
       2.54483100d0, 2.74640188d0, 2.82199085d0, 2.74640188d0, &
       2.89757982d0, 2.77159820d0, 2.87238349d0, 2.94797246d0, &
       4.76210950d0, 4.20778980d0, 3.70386304d0, 3.50229216d0, &
       3.32591790d0, 3.12434702d0, 2.89757982d0, 2.84718717d0, &
       2.84718717d0, 2.72120556d0, 2.89757982d0, 3.09915070d0, &
       3.22513231d0, 3.17473967d0, 3.17473967d0, 3.09915070d0, &
       3.32591790d0, 3.30072128d0, 5.26603625d0, 4.43455700d0, &
       4.08180818d0, 3.70386304d0, 3.98102289d0, 3.95582657d0, &
       3.93062995d0, 3.90543362d0, 3.80464833d0, 3.82984466d0, &
       3.80464833d0, 3.77945201d0, 3.75425569d0, 3.75425569d0, &
       3.72905937d0, 3.85504098d0, 3.67866672d0, 3.45189952d0, &
       3.30072128d0, 3.09915070d0, 2.97316878d0, 2.92277614d0, &
       2.79679452d0, 2.82199085d0, 2.84718717d0, 3.32591790d0, &
       3.27552496d0, 3.27552496d0, 3.42670319d0, 3.30072128d0, &
       3.47709584d0, 3.57788113d0, 5.06446567d0, 4.56053862d0, &
       4.20778980d0, 3.98102289d0, 3.82984466d0, 3.85504098d0, &
       3.88023730d0, 3.90543362d0 /)

! DFT-D3
      step=0
      do iat=1,n-1
         do jat=iat+1,n
         step=step+1
         r=dist(step)
         c6=c6a(step)
! r2r4 stored in main as sqrt
         c8 =3.0d0*c6*r2r4(iz(iat))*r2r4(iz(jat))

! energy for BJ damping
          tmp=sqrt(c8/c6)
          e6(step)= c6/(r**6+(a1*tmp+a2)**6)
          e8(step)= c8/(r**8+(a1*tmp+a2)**8)
! calculate gradients
         if (igrad .eq. 1) then
! grad for BJ damping
          e6dr(step)=c6*(-6*r**5)/(r**6+(a1*tmp+a2)**6)**2
          e8dr(step)=c8*(-8*r**7)/(r**8+(a1*tmp+a2)**8)**2
         endif
         enddo
      enddo

      end subroutine edisp


      subroutine n2ground(r,v,grad,imol,igrad)
!**********************************************************************
!
! Compute the diatomic potential of ground-state N2 (singlet)
!
! Input:  r      interatomic distance in Angstrom
!         imol   1 - stands for N2 for N4 PES
!         igrad  1 - gradient is calculated
!                0 - gradient is not calculated
! Output: V      potential in kcal/mol
!         grad   gradient (kcal/mol)/Angstrom
! QM commented line 628-631 650-652 708-712 728-730 
!**********************************************************************
      implicit none

      integer,intent(in) :: imol, igrad
      double precision :: r
      double precision :: v, grad
      double precision :: re, de, as(0:6)
      double precision :: y, fy, u
      double precision :: dfdy,rr,dydr,dfdr
      integer :: k, a
! Dispersion variables
      double precision :: dist(1),disp,dispdr(1)

! Modified parameters for D3(BJ)
        re=1.098d0
        de=  224.9157d0 ! 228.4d0 
        as(0) =  2.7599278840949d0  ! 2.71405774451d0
        as(1) =  0.2318898277373d0  ! 1.32757649829d-1
        as(2) =  0.1908422945648d0  ! 2.66756890408d-1
        as(3) = -0.2727504034613d0  ! 1.95350725241d-1
        as(4) = -0.5345112219335d0  !-4.08663480982d-1
        as(5) =  1.0857331617073d0  ! 3.92451705557d-1
        as(6) =  1.6339897930305d0  ! 1.13006674877d0

      v=0.0d0

      y=(r**4 - re**4)/(r**4 + re**4)

      fy = as(6)
      do a=5,0,-1
         fy = fy*y
         fy = fy + as(a)
      enddo

      u=exp(-fy*(r-re))

      v=de*(1.0d0-u)*(1.0d0-u)-de


!! Add D3 dispersion correction
        dist(1)=r
        call d3disp(dist,disp,dispdr,0,imol)
        v=v+disp

! Compute the gradient if needed
      if (igrad.eq.1) then
       grad=0.d0

!      dfdy = as(1) + 2.0d0*as(2)*y + 3.0d0*as(3)*y*y &
!           + 4.0d0*as(4)*y*y*y + 5.0d0*as(5)*y*y*y*y &
!           + 6.0d0*as(6)*y*y*y*y*y
        dfdy = as(6)*6.0d0
        do a=5,1,-1
          dfdy = dfdy*y
          dfdy = dfdy + as(a)*a
        enddo
        rr = r**4 + re**4
        dydr = 8.0d0*r**3*re**4/(rr*rr)
        dfdr = dfdy*dydr
        grad = 2.0d0*de*(1-u)*u*(dfdr*(r-re)+fy)

! Add analytical gradient of D3 dispersion correction
        call d3disp(dist,disp,dispdr,1,imol)
        grad= grad + dispdr(1)

      endif
      return
      end subroutine n2ground

     subroutine noground(r,v,grad,imol,igrad)
!**********************************************************************
!
! Compute the diatomic potential of ground-state NO (doublet)
!
! Input:  r      interatomic distance in Angstrom
!         imol   3 - stands for NO for N2O2 PES
!         igrad  1 - gradient is calculated
!                0 - gradient is not calculated
! Output: V      potential in kcal/mol
!         grad   gradient (kcal/mol)/Angstrom
!
! Short range NO parameters for NO dissociation
! The long range term comes from dispersion
! The difference between the points of the 8th order MEG NO diatomic
! potential and the dispersion corrections was refitted by a 10th
! order MEG polynomial
!**********************************************************************
      implicit none

      integer,intent(in) :: imol, igrad
      double precision :: r
      double precision :: v, grad
      double precision :: re, de, c(1:12), u
      double precision :: dydr,dfdr
! Dispersion variables
      double precision :: dist(1),disp,dispdr(1)
        re=   1.1508d0
        de=   149.47844d0   !152.6d0
        c(1)  = -1.385343053807088d-01
        c(2)  =  1.889990874379912d+00
        c(3)  = -4.297653558650669d+00
        c(4)  =  2.143053955670876d+01
        c(5)  = -4.434782706902637d+01
        c(6)  =  4.107240828842039d+01
        c(7)  = -1.090996257595447d+01
        c(8)  = -1.068726081590712d+01
        c(9)  =  9.189735457956482d+00
        c(10) = -2.201965266358976d+00
        c(11) =  8.966018393955543d-01 ! delta b
        c(12) =  2.069542710330378d+00 ! delta c
!  for NO
! MEG variable
       u=exp(-(r-re)/c(11)-(r-re)**2.0d0/c(12))
! Pair-wise potential
       v=0.d0
       v= (-de)*(c(1)*u**1.0d0 + c(2)*u**2.0d0 + c(3)*u**3.0d0 &
               + c(4)*u**4.0d0 + c(5)*u**5.0d0 + c(6)*u**6.0d0 &
               + c(7)*u**7.0d0 + c(8)*u**8.0d0 + c(9)*u**9.0d0 &
               + c(10)*u**10.0d0 )
! Add D3 dispersion correction
!        write(*,*) "vno= ",v
        dist(1)=r
        call d3disp(dist,disp,dispdr,0,imol)
        v=v+disp
!        write(*,*) "dispno= ",disp
! 1st derivate by r
      if (igrad .eq. 1) then
! multiplier part of the MEG derivate
       dfdr=(-2.0d0*(r-re)/c(12)-1.0d0/c(11))
       grad =  - de*(c(1)*1.0d0*dfdr*u**1.0d0 &
                   + c(2)*2.0d0*dfdr*u**2.0d0 &
                   + c(3)*3.0d0*dfdr*u**3.0d0 &
                   + c(4)*4.0d0*dfdr*u**4.0d0 &
                   + c(5)*5.0d0*dfdr*u**5.0d0 &
                   + c(6)*6.0d0*dfdr*u**6.0d0 &
                   + c(7)*7.0d0*dfdr*u**7.0d0 &
                   + c(8)*8.0d0*dfdr*u**8.0d0 &
                   + c(9)*9.0d0*dfdr*u**9.0d0 &
                   + c(10)*10.0d0*dfdr*u**10.0d0 )
! Add analytical gradient of D3 dispersion correction
        call d3disp(dist,disp,dispdr,1,imol)
        grad= grad + dispdr(1)
      endif
      return
      end subroutine noground

